import React, { useState } from "react";
import { motion } from "framer-motion";

export default function LoginForm() {
	const [isUser, setIsUser] = useState({ username: "", password: "" });

	return (
		<motion.div className="form-wrapper">
			<motion.div className="login-wrapper">
				<motion.div>
					<h2>Please login</h2>
				</motion.div>
				<hr />
				<div>
					<form action="/" method="post">
						<input type="text"></input>
						<input type="password"></input>
						<button
							onClick={setIsUser({ username: "test", password: "test" })}
							type="submit">
							Login
						</button>
					</form>
					<span>
						Don't have an account? <a>Register Here</a>
					</span>
				</div>
			</motion.div>
		</motion.div>
	);
}
